def run(value_list):
    """
    Calculates the difference between the domestic and international discount rates as at September 30, 2019.

    Args:
        value_list: A list of dictionaries, where each dictionary represents a financial value.

    Returns:
        A tuple containing the difference in discount rates and the scale.
    """
    domestic_rate_2019 = None
    international_rate_2019 = None

    for item in value_list:
        if item['header1'] == '2019' and item['header2'] == 'September 30,' and item['header3'] == 'Domestic':
            domestic_rate_2019 = item['number_value']
        if item['header1'] == '2019' and item['header2'] == 'September 30,' and item['header3'] == 'International':
            international_rate_2019 = item['number_value']

    if domestic_rate_2019 is not None and international_rate_2019 is not None:
        difference = domestic_rate_2019 - international_rate_2019
        return (round(difference, 2), 'percent')
    else:
        return (None, '')

